import React from 'react';
import { Box, Typography, Divider } from '@mui/material';
import CampusMap from '../CampusMap'; // Import the CampusMap component

const WeeklyProgress = () => {
    return (
        <Box
            sx={{
                mt: 4,
                position: 'relative', // Enable stacking of elements
                height: '50vh', // Occupy the bottom half of the screen
                display: 'flex',
                flexDirection: 'column',
                justifyContent: 'space-between', // Adjust alignment
            }}
        >
            {/* Weekly Progress Content */}
            <Box
                sx={{
                    zIndex: 1, // Keep content above the map
                    bgcolor: 'rgba(255, 255, 255, 0.9)', // Semi-transparent background
                    borderRadius: 1,
                    p: 2,
                    backdropFilter: 'blur(4px)', // Optional frosted glass effect
                }}
            >
                <Typography variant="h6" gutterBottom>
                    Weekly Progress
                </Typography>
                <Divider sx={{ mb: 2 }} />
                <Box sx={{ display: 'flex', justifyContent: 'space-between' }}>
                    <Box
                        sx={{
                            width: '48%',
                            bgcolor: 'rgba(255, 255, 255, 0.7)',
                            p: 2,
                            borderRadius: 1,
                            backdropFilter: 'blur(4px)',
                        }}
                    >
                        Assignments Assigned
                    </Box>
                    <Box
                        sx={{
                            width: '48%',
                            bgcolor: 'rgba(255, 255, 255, 0.7)',
                            p: 2,
                            borderRadius: 1,
                            backdropFilter: 'blur(4px)',
                        }}
                    >
                        Completion Rate
                    </Box>
                </Box>
            </Box>

            {/* Map Background */}
            <Box
                sx={{
                    position: 'absolute',
                    bottom: 0, // Push to the bottom of the section
                    left: 0,
                    right: 0,
                    height: '40%', // Take up less space
                    zIndex: 0, // Keep it behind the content
                }}
            >
                <CampusMap />
            </Box>
        </Box>
    );
};

export default WeeklyProgress;
